  styleUrls: ['./password-input.component.css']
})
export class PasswordInputComponent {

}
<input 
    type="text"
    class="py-2 px-3 rounded-md text-zinc-100 placeholder:text-zinc-300 bg-zinc-900 w-full border-[1px] border-zinc-800 outline-none"
